import React from "react";

import Card from "../../UI/Card/Card";
import classes from "./MainPage.module.css"

const MainPage = (props) => {
  return (
    <React.Fragment>
      <Card className={classes.index}>
        <p>good</p>
        <p>{props.id}</p>
      </Card>
    </React.Fragment>
  );
};

export default MainPage;
